/**
 * ```
 * not
 * ```
 * -----------------------------------------------------------------------------
 * Takes a _value_ and returns it's [logical not][1].
 *
 * ```
 * not('foo') <=> !'foo' <=> false
 * ```
 *
 * [1]: https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Operators/Logical_Operators#Logical_NOT_(!)
 *
 */
export declare function not(a: any): boolean
